import React from "react";
import {Link} from 'react-router-dom'

function About(){
    return(
        <div className="card">
            <h1>About this project</h1>
            <p>This is a React app to leave feedback for a product or service </p>
            <p>Version: 1.0.0</p>
            <p>
                <Link to="/">Back To Home</Link>
            </p>
        </div>
    )
}
export default About
